int main(void)
{
    volatile int * pixel_ctrl_ptr = (int *)PIXEL_BUF_CTRL_BASE;
    // volatile int* slider_ptr = (int *)0xFF200040;
    // declare other variables(not shown)
    // initialize location and direction of rectangles(not shown)
    int boxX,boxY,fishX,fishY,fishDeltaY,boxWidth,boxHeight,fishWidth,fishHeight,netX,netY,netDeltaY,netWidth,netHeight,pbarX,pbarY,pbarWidth,pbarHeight;
    short int pbarCol = 0x00FF00;
    short int fishCol = 0x0000FF;
    short int boxCol = 0xffffff;
    short int netCol = 0xFFCCCB;
    
    // initialize gamestate
    int gamestate = 0;
    
    //set starting locations for box and fish and net and progress bar (pbar)
    boxWidth = 50;
    boxHeight = 200;
    boxX = 243; //50
    boxY = 240-boxHeight; //10
    netWidth = 16;
    netHeight = 50;
    netX = boxX + boxWidth/2 - netWidth/2;
    netY = 70;
    netDeltaY = 10;
    fishWidth = 16;
    fishHeight = 16;
    fishX = netX + netWidth/2 - fishWidth/2;
    fishY = 100;
    pbarWidth = 10;
    pbarHeight = 45;
    pbarX = boxX + boxWidth - pbarWidth;
    pbarY = boxY + boxHeight- pbarHeight;
    int pbarChange = 2;

    //score
    int score = 0;
    int HIscore = 0;
    //scoreboard
    int scoreWidth = 80;
    int scoreHeight = 40;
    int scoreX = 5; //320 - scoreWidth - 10
    int scoreY = 160; //10
    int scoreColor = 0xffffff; //white
    
    srand(rand()%5 + 1);
    int timerDiff[7] = {1, 5, 5, 6, 7, 7, 7}; // time b/w jumps
    int stepDiff[7] = {9, 9, 6, 5, 4, 4, 4}; // distance of jumps
    int diffI = rand()%7;
    int timeAdjust = timerDiff[diffI];
    //set starting direction for fish
    int timer = (rand()%7) + timeAdjust;
    int timerCount = 0;
    
    /* set front pixel buffer to Buffer 1 */
    *(pixel_ctrl_ptr + 1) = (int) &Buffer1; // first store the address in the  back buffer
    /* now, swap the front/back buffers, to set the front buffer location */
    wait_for_vsync();
    /* initialize a pointer to the pixel buffer, used by drawing functions */
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen(); // pixel_buffer_start points to the pixel buffer
    /* set back pixel buffer to Buffer 2 */
    *(pixel_ctrl_ptr + 1) = (int) &Buffer2;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
    clear_screen(); // pixel_buffer_start points to the pixel buffer
    
    // PS/2 mouse needs to be reset (must be already plugged in)
    *(PS2_ptr) = 0xFF; // reset

    // start screen
    
    while (1)
    {
        if(gamestate == 0){
            score = 0;
            getKeyboardInput(PS2_ptr);
            while(byte3 != 0x29 || byte2 != 0xF0){
                getKeyboardInput(PS2_ptr);
                plot_image_start();
                plot_scoreboard(score, HIscore, scoreX, scoreY, scoreWidth, scoreHeight, scoreColor);
                wait_for_vsync(); // swap front and back buffers on VGA vertical sync
                pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
            }

           gamestate = 1;
            for(int drawIndex = 0 ; drawIndex < 2 ; drawIndex++){
                erase_image_start();
                plot_image_fishing_background();
                wait_for_vsync(); // swap front and back buffers on VGA vertical sync
                pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
            }

		}
        else if(gamestate == 1){
            // update high score
            if (score > HIscore) HIscore = score;
			getKeyboardInput(PS2_ptr);
            //draw box
            plot_image_box(boxX, boxY);
            //plot_box(boxX, boxY, boxWidth, boxHeight, boxCol);
            
            //draw net
            plot_net(netX, netY, netWidth, netHeight, netCol);
            
            //draw fish
            plot_image_fish(fishX, fishY);
            
            //draw pbar
            plot_pbar(pbarX, pbarY, pbarWidth, pbarHeight, pbarCol);
            
            //drawing scoreboard
            plot_scoreboard(score, HIscore, scoreX, scoreY, scoreWidth, scoreHeight, scoreColor);
            
            //update timer stuff
            if(timerCount == timer){
                fishDeltaY = rand()%(2*stepDiff[diffI]+1)-stepDiff[diffI];
                timerCount = 0;
                timer = (rand()%7) + timeAdjust;
            }
            //checking if fish is within net
            if(fishY + fishHeight > netY && fishY < netY + netHeight){
                pbarChange = -2;
            }
            else{
                if (pbarHeight > 120) {
                	pbarChange  = 3;
                } else if (pbarHeight > 60) {
                	pbarChange = 2;
                }
                else {
                	pbarChange = 1;
                }
            }
            //updating score
            if(pbarY < boxY + 10){
                for(int i = 0 ; i < 396 ; i++){
                    playVictoryNoise();
                }
                score++;
				netY = 70;
				fishY = 100;
                pbarHeight = 45;
                pbarY = boxY + boxHeight - pbarHeight;
                diffI = rand()%7;
            } else if (pbarHeight < 1) {
				for(int i = 0 ; i < 120 ; i++){
                    playLossNoise();
                }
                // reset game variables to start fresh
				score = 0;
				netY = 70;
				fishY = 100;
                pbarHeight = 45;
                pbarY = boxY + boxHeight - pbarHeight;
                diffI = rand()%7;
				byte1 = 0;
				byte2 = 0;
				byte3 = 0;
				gamestate = 0;
            } 
				

            // code for updating the locations of boxes (not shown)
            if(fishY+fishDeltaY <= boxY || fishY+fishDeltaY+fishHeight >= boxY + boxHeight){
                fishDeltaY *= -1;
            }

            //update net location
            if (byte2 == 0x29 && byte3 == 0x29) {
                netDeltaY= -7;
            }
            else {
                netDeltaY = 5;
            }
            if(netY + netDeltaY > boxY && netY+netDeltaY+netHeight < boxY + boxHeight){	
                netY += netDeltaY;
            }
            if(pbarY + pbarChange >= boxY && pbarY + pbarHeight <= boxY + boxHeight){
                pbarY += pbarChange;
                pbarHeight -= pbarChange;
            }

            // update fish location
            fishY += fishDeltaY;
            timerCount++;

            wait_for_vsync(); // swap front and back buffers on VGA vertical sync
            pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
            // //draw net
            erase_net(netX, netY, netWidth, netHeight);
            
            // //draw fish
            erase_image_fish(fishX, fishY);

            //draw pbar
            erase_pbar(pbarX, pbarY, pbarWidth, pbarHeight);
        }
    }
}

// VGA subroutines
void playVictoryNoise(){	//sound effects
    volatile int* audio_ptr = (int*) AUDIO_BASE;
    int winFreq = 4000;
    int winSamplePeriod = 8000 / winFreq;
    // high
    for (int i = 0; i < winSamplePeriod/2; i++){
        int fifospace = *(audio_ptr + 1);
        if ((fifospace & 0x00FF0000) > 0)
        {
            *(audio_ptr + 2) = 0x7FFFFFF;
            *(audio_ptr + 3) = 0x7FFFFFF;
        }
    }

    // low
    for (int j = 0; j < winSamplePeriod/2; j++){
        int fifospace = *(audio_ptr + 1);
        if((fifospace & 0x00FF0000) > 0)
        {
            *(audio_ptr + 2) = 0;
            *(audio_ptr + 3) = 0;
        }
    }
}

void playLossNoise(){	//sound effects
    volatile int* audio_ptr = (int*) AUDIO_BASE;
    int lossFreq = 300;
    int lossSamplePeriod = 8000 / lossFreq;
    // high
    for (int i = 0; i < lossSamplePeriod/2; i++){
        int fifospace = *(audio_ptr + 1);
        if ((fifospace & 0x00FF0000) > 0)
        {
            *(audio_ptr + 2) = 0x7FFFFFF;
            *(audio_ptr + 3) = 0x7FFFFFF;
        }
    }

    // low
    for (int j = 0; j < lossSamplePeriod/2; j++){
        int fifospace = *(audio_ptr + 1);
        if((fifospace & 0x00FF0000) > 0)
        {
            *(audio_ptr + 2) = 0;
            *(audio_ptr + 3) = 0;
        }
    }
}

